sqlite3 *db; //database handle
sqlite3_stmt *stmt; //statment handle
char sql[450000+1024]; //sql statement string
int rc;

//zlib buffer
char z_blob[100000];


void sokoban_load_solution(SOKOBAN *skb, int t){

	int len;

	//for zlib
	z_stream strm;
	int z_size;

	if(!sokoban_lookup_solution(skb, NULL)) return; // no solution in database

	sokoban_restart(skb);

	//select
	if(t==LS_MOVE)
		sprintf(sql, "SELECT mslt FROM solutions WHERE key='%llx' AND key2='%llx'", skb->key, skb->key2);
	else if(t==LS_PUSH)
		sprintf(sql, "SELECT pslt FROM solutions WHERE key='%llx' AND key2='%llx'", skb->key, skb->key2);
 	if( (rc=sqlite3_prepare(db,sql,-1, &stmt, NULL ) )!= SQLITE_OK) {
		printf("sqlite3_prepare():%d\n", rc);
	}
	while((rc=sqlite3_step(stmt) )== SQLITE_ROW ){


		//printf("(%d/%d)-(%d,%d)\n",n4[0],n4[1],n4[2],n4[3]);
		strm.avail_in =sqlite3_column_bytes(stmt,0) ; //get the #bytes of the blob
		memcpy(z_blob,sqlite3_column_blob(stmt,0), strm.avail_in );
		//len = strlen(z_blob);

		//do the zlib decompression
		strm.zalloc=Z_NULL;
		strm.zfree=Z_NULL;
		strm.opaque= Z_NULL;
		//g_message("haha -1");
		inflateInit( &strm);
		//g_message("haha 0");
		strm.next_out = sql;
		strm.avail_out = 450000+1024;
		strm.next_in=z_blob;
		//strm.avail_in is already set 10 lines up
		if( inflate(&strm,Z_FINISH)==Z_STREAM_END){
			//g_message("haha 1");			
			len =	(char *)strm.next_out - sql;	
			sql[len]='\0';	
			g_message("unzlib : %d ", len);
			//z_blob[(char *)strm.next_out - z_blob]='\0';
			//g_message("zlibed:%s", z_blob);

		}
		else g_message("uh-oh: zlib inflate error! ");
		inflateEnd(&strm); 

		if(len > skb->solution_len){ //request for more memory
			skb->solution_len = len+10;
			skb->solution=realloc(skb->solution, skb->solution_len);
		}

		strcpy(skb->solution, sql);
		skb->solution_head=len;

		//printf("%s\n", temp);

	}
	if(rc!=SQLITE_DONE){
		printf("sqlite3_step():%d\n", rc);
	}
	sqlite3_finalize(stmt);

	



}



//return 1 if solution found, otherwise 0
//the #move/#push are saved in m4
// m4 can be NULL if you don't want to retrieve the numbers
int sokoban_lookup_solution(SOKOBAN *skb, int *m4){

	//char temp[5555];
	int n4[4];
	int found=0;
	int i;

	//select
	sprintf(sql, "SELECT mm, mp, pm, pp FROM solutions WHERE key='%llx' AND key2='%llx'", skb->key, skb->key2);
 	if( (rc=sqlite3_prepare(db,sql,-1, &stmt, NULL ) )!= SQLITE_OK) {
		printf("sqlite3_prepare():%d\n", rc);
	}
	while((rc=sqlite3_step(stmt) )== SQLITE_ROW ){
		//printf("sqlite3_step():%d\n", rc);
		n4[0]=sqlite3_column_int(stmt,0);
		n4[1]=sqlite3_column_int(stmt,1);
		n4[2]=sqlite3_column_int(stmt,2);
		n4[3]=sqlite3_column_int(stmt,3);
		if(m4!=NULL){
			for(i=0;i<4;i++) m4[i]=n4[i];
		}

		//printf("(%d/%d)-(%d,%d)\n",n4[0],n4[1],n4[2],n4[3]);
		//strcpy(temp,sqlite3_column_text(stmt,4) );
		//printf("%s\n", temp);

		found=1;
	}
	if(rc!=SQLITE_DONE){
		printf("sqlite3_step():%d\n", rc);
	}
	sqlite3_finalize(stmt);

	return found;

}

void sokoban_save_solution(SOKOBAN *skb){

	int m4[4];

	//for zlib
	z_stream strm;
	int z_size;


	//do the zlib compression
	strm.zalloc=Z_NULL;
	strm.zfree=Z_NULL;
	strm.opaque= Z_NULL;
	//g_message("haha -1");
	deflateInit( &strm, 9);
	//g_message("haha 0");
	strm.next_in=skb->solution;
	strm.avail_in=skb->solution_tail;
	strm.next_out=z_blob;
	strm.avail_out =100000;
	if( deflate(&strm,Z_NO_FLUSH)==Z_OK){
		//g_message("haha 1");
		if(deflate(&strm, Z_FINISH)==Z_STREAM_END){			
			z_size=	(char *)strm.next_out - z_blob;		
			g_message("zlib : %d",z_size);
			//z_blob[(char *)strm.next_out - z_blob]='\0';
			//g_message("zlibed:%s", z_blob);
		}
	}
	deflateEnd(&strm); 
	
	
	skb->solution[skb->solution_tail]='\0';

	if(!sokoban_lookup_solution(skb,m4)){
		//insert an entry
		sprintf(sql, "INSERT INTO solutions (key,key2, mm,mp, mslt, pm, pp, pslt) VALUES ('%llx','%llx','%d','%d',?,'%d','%d',? )", 
			skb->key, skb->key2, skb->solution_tail, skb->n_push,  skb->solution_tail, skb->n_push  );
		if( (rc=sqlite3_prepare_v2(db,sql,-1, &stmt, NULL ) )!= SQLITE_OK) {
			printf("sqlite3_prepare():%d\n", rc);
		}
		sqlite3_bind_blob(stmt,1,z_blob, z_size , SQLITE_TRANSIENT);
		sqlite3_bind_blob(stmt,2,z_blob, z_size , SQLITE_TRANSIENT);
		if((rc=sqlite3_step(stmt) )!= SQLITE_DONE ){
			printf("sqlite3_step():%d\n", rc);
		}
		sqlite3_finalize(stmt);
	}
	else{




		if( skb->solution_tail<m4[0] || (skb->solution_tail==m4[0] && skb->n_push <m4[1] ) ){ //a better solution for #moves
			//insert an entry
			sprintf(sql, "UPDATE solutions SET mm='%d', mp='%d', mslt=? WHERE key='%llx' AND key2='%llx'", 
				skb->solution_tail, skb->n_push,  skb->key, skb->key2 );
			if( (rc=sqlite3_prepare_v2(db,sql,-1, &stmt, NULL ) )!= SQLITE_OK) {
				printf("sqlite3_prepare():%d\n", rc);
			}
			sqlite3_bind_blob(stmt,1,z_blob, z_size , SQLITE_TRANSIENT);
			if((rc=sqlite3_step(stmt) )!= SQLITE_DONE ){
				printf("sqlite3_step():%d\n", rc);
			}
			sqlite3_finalize(stmt);
		}

		if( skb->n_push < m4[3] || (skb->solution_tail < m4[2] && skb->n_push == m4[3] ) ){ //a better solution for #pushes
			//insert an entry
			sprintf(sql, "UPDATE solutions SET pm='%d', pp='%d', pslt=? WHERE key='%llx' AND key2='%llx'", 
				skb->solution_tail, skb->n_push,   skb->key, skb->key2 );
			if( (rc=sqlite3_prepare_v2(db,sql,-1, &stmt, NULL ) )!= SQLITE_OK) {
				printf("sqlite3_prepare():%d\n", rc);
			}
			sqlite3_bind_blob(stmt,1,z_blob, z_size , SQLITE_TRANSIENT);
			if((rc=sqlite3_step(stmt) )!= SQLITE_DONE ){
				printf("sqlite3_step():%d\n", rc);
			}
			sqlite3_finalize(stmt);
		}

	}
	
	return;
}






//open the solution database if exist
//otherwise, create it
void sokoban_open_solution_db(){

	char solution_filename[1024]; //database filename


	

	const gchar *home_path=g_get_home_dir();

	strcpy(solution_filename, home_path);
	strcat(solution_filename,"/.usokoban.solutions");

	//open database
	if( (rc=sqlite3_open(solution_filename, &db) )!=SQLITE_OK){
		printf("sqlite3_open():%d\n", rc);
	}


	//printf("\nsqlite:%d\n",rc);

	//create table
	strcpy(sql, "CREATE TABLE IF NOT EXISTS solutions (key CHAR(16), key2 CHAR(16), mm INTEGER, mp INTEGER, mslt BLOB, pm INTEGER, pp INTEGER, pslt BLOB )");
	if( (rc=sqlite3_prepare(db,sql,-1, &stmt, NULL ) )!= SQLITE_OK) {
		printf("sqlite3_prepare():%d\n", rc);
	}
	if((rc=sqlite3_step(stmt) )!= SQLITE_DONE ){
		printf("sqlite3_step():%d\n", rc);
	}
	sqlite3_finalize(stmt);

}


//close
void sokoban_close_solution_db(){
	//close database
	sqlite3_close(db);
}




//find zobrist key using the target map
unsigned long long sokoban_find_zobrist_key_2(SOKOBAN *skb, ZOBRIST_KEY *zob, int boardsize){
	ZOBRIST_KEY zkey=0;

	int i,bi=0;

	for(i=0;i<skb->w*skb->h;i++){
		switch(skb->level[i]){
			case '$':
			case '@':
			case '-':
				if(skb->target[i]=='.') zkey^=zob[bi];
				bi++;
			break;
			default: 
			break;
		

		}
		if (bi>=boardsize) return zkey;
	}
	//printf("zkey=%llX,hash_value= %llu [%u], (%u)\n",zkey,  (zkey % (1024*1024) ),(int) (zkey % (1024*1024)), bi );

	//level_2_bitstring(skb->level, skb->w, skb->h);
	return zkey;


}


